import React, { Component } from "react";
import Expanded from "./Assets/ExpandedInsurence.jpg";

import { Container } from "react-bootstrap";

class Profile extends React.Component {
  render() {
    return (
      <Container>
        <Tab.Container defaultActiveKey="first">
          <Row>
            <Col sm={3}>
              <Nav>
                <Nav.Item>
                  <Nav.Link eventKey="first">Desing</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Nav.Link eventKey="second">Desing</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Nav.Link eventKey="third">Desing</Nav.Link>
                </Nav.Item>
              </Nav>
            </Col>
            <Col sm={9}>
              <Tab.Contant>
                <Tab.Pane eventKey="first">
                  {Expanded}
                  <h1>Гани Галиев</h1>
                </Tab.Pane>
              </Tab.Contant>
            </Col>
          </Row>
        </Tab.Container>
      </Container>
    );
  }
}

export default Profile;
